import React, { useEffect, useState } from 'react';
import {Line} from 'react-chartjs-2';

const ChartPie = () => {
    const [chartData, setChartData] = useState({})

    const chart = () => {
        setChartData({
            labels: ['monday', 'tuesday'],
            datasets: [
                {
                    label: 'levels',
                    data: [32, 45],
                    backgroundColor: [
                        'rgba(75, 192, 192, 0.6)'
                    ],
                    borderWidth: 4
                }
            ]
        })
    }
    useEffect(() => {
        chart()
    }, [])
    return(
        <div>
            <h1>GRAFICO GERAL</h1>
            <div>
               <Line data={chartData} /> 
            </div>
        </div>
    )
}

export default ChartPie;
